<template>
  <div class="container">
    <div class="page-login">
      <div class="page-login--layer" :style="winHeight">
        <!-- left -->
        <div class="page-login--content left" flex="dir:top main:justify cross:stretch box:justify">
          
          <div class="page-login--content-main" flex="dir:top main:center cross:center">
            
            <h3>System Manage</h3>
            <!-- form -->
            <div class="page-login--form">
              <el-card shadow="never">
                <el-form
                  ref="loginForm"
                  label-position="top"
                  :rules="rules"
                  :model="formLogin"
                  size="default">
                  <el-form-item prop="username">
                    <el-input
                      type="text"
                      v-model="formLogin.username"
                      placeholder="用户名">
                      <i slot="prepend" class="fa el-icon-user"></i>
                    </el-input>
                  </el-form-item>
                  <el-form-item prop="password">
                    <el-input
                      type="password"
                      v-model="formLogin.password"
                      placeholder="密码">
                      <i slot="prepend" class="fa el-icon-lock"></i>
                    </el-input>
                  </el-form-item>
                  
                  <el-button
                    size="default"
                    @click="submit"
                    type="primary"
                    class="button-login">
                    登录
                  </el-button>
                </el-form>
              </el-card>
              
            </div>
          </div>
          
          <div class="page-login--content-footer-options">
            <a>帮助</a>
            <a>隐私</a>
            <a>条款</a>
          </div>

        </div>
        <!-- right -->
        <div class="page-login--content-footer right"></div>
        
      </div>
      
    </div>
  </div>
</template>

<script>
import { mapActions } from 'vuex'
export default {
  data () {
    return {
      winHeight: '',
      // 表单
      formLogin: {
        username: 'admin',
        password: 'admin'
      },
      // 表单校验
      rules: {
        username: [
          {
            required: true,
            message: '请输入用户名',
            trigger: 'blur'
          }
        ],
        password: [
          {
            required: true,
            message: '请输入密码',
            trigger: 'blur'
          }
        ]
      }
    }
  },
  mounted () {
    console.log(window.innerHeight)
    this.winHeight = 'height:'+ window.innerHeight + 'px'
  },
  beforeDestroy () {
  },
  methods: {
    ...mapActions('account', [
      'login'
    ]),
    /**
     * @description 提交表单
     */
    // 提交登录信息
    submit () {
      this.$refs.loginForm.validate((valid) => {
        if (valid) {
          // 登录
          // 注意 这里的演示没有传验证码
          // 具体需要传递的数据请自行修改代码
          this.login({
            username: this.formLogin.username,
            password: this.formLogin.password
          }).then((res) => {
            console.log('提交登录----', res)
            // 重定向对象不存在则返回顶层路径
            this.$router.replace(this.$route.query.redirect || '/')
            })
        } else {
          // 登录表单校验失败
          this.$message.error('表单校验失败，请检查')
        }
      })
    }
  }
}
</script>

